import React, { useContext } from 'react';
import PropTypes from 'prop-types';
import myContext from '../Context/myContext';

function HeightAndWidth({ handleFunctions }) {
  const { handleHeight, handleWidth } = handleFunctions;
  const { heightOne, widthtOne } = useContext(myContext);
  return(
    <div>
      <label htmlFor="height">
      altura
      <input
        type="number"
        id="height"
        value={ heightOne }
        onChange={ handleHeight }
      />
      </label>
      <label htmlFor="width">
        largura
        <input
          type="number"
          id="width"
          value={ widthtOne }
          onChange={ handleWidth }
        />
      </label>
    </div>
  );
}

HeightAndWidth.propTypes = {
  handleFunctions: PropTypes.objectOf(PropTypes.shape({
    handleHeight: PropTypes.func,
    handleWidth: PropTypes.func,
  })).isRequired,
};

export default HeightAndWidth;
